                values: new object[,]
                {
                    { 50, 7, null, 50000m, null, null, null, "r50.pdf", "74e24bb6-9fb0-4be7-aba9-9397104bd0ba", null, "vantoniuttiu@smugmug.com", true, null, null, null, "là một Project Manager năng động nổi tiếng với tư duy chiến lược và kế hoạch tỉ mỉ. Với lý lịch trong quản trị kinh doanh kết hợp với kinh nghiệm trong quản lý dự án, anh có góc nhìn độc đáo trong việc xử lý các dự án phức tạp. Phong cách lãnh đạo của Rajesh được đặc trưng bởi khả năng truyền cảm hứng và khích lệ các thành viên trong đội làm việc của anh để đạt được tối đa hiệu quả làm việc của họ. Lấy cảm hứng từ văn học và triết học cổ điển Ấn Độ, Rajesh tiếp cận quản lý dự án với tư duy toàn diện, luôn xem xét tầm nhìn toàn diện và hậu quả dài hạn của quyết định của mình", false, false, null, null, null, "$2a$04$JLiq0tTWaA6IJjXw1VdCq.2L2nqZwnICsp8RNPPCEMDqD/CYhe9UK", null, true, "i50.png", null, null, (short)1, false, "Vale Antoniutti" },
                    { 51, 6, null, 51000m, null, null, null, "r51.pdf", "f304a9b2-2bcb-4555-9ba5-329fcc9459f9", null, "sdellv@sakura.ne.jp", false, null, null, null, "Alok là một Project Manager chuyên nghiệp nổi tiếng với cam kết kiên định đối với việc đạt được kết quả. Với lý lịch trong kỹ thuật cơ khí, anh có ánh mắt tinh tế và phương pháp giải quyết vấn đề một cách hệ thống. Phong cách lãnh đạo của Alok được đặc trưng bởi khả năng giữ bình tĩnh dưới áp lực và khả năng tìm ra các giải pháp hiệu quả cho những thách thức phức tạp. Lấy cảm hứng từ các triết lý cổ điển Ấn Độ, Alok tin rằng việc tự phản ánh và liên tục cải tiến là quan trọng, luôn cố gắng hoàn thiện kỹ năng quản lý dự án của mình và dẫn dắt đội ngũ của mình đến sự xuất sắc.", true, true, null, null, null, "$2a$04$qxZ0IO6WgnYGcXemkruc4uxe68Yb18G9HuxlstWmridNvTu0Ba2QC", null, false, "i51.png", null, null, (short)1, true, "Stanley Dell Casa" },
                    { 52, 5, null, 52000m, "Creating multiple accounts to evade bans or restrictions (ban evasion)", null, null, "r52.pdf", "e3a5c99d-05a5-4626-b897-bbd38a91fd86", null, "rmcillroyw@amazon.de", true, new DateTime(2023, 7, 1, 9, 47, 0, 0, DateTimeKind.Unspecified), null, null, "Neha là một Project Manager thông minh với sự linh hoạt và sự kiên nhẫn trong việc vượt qua môi trường dự án phức tạp. Với lý lịch trong công nghệ thông tin, cô giỏi sử dụng công nghệ để tối ưu hóa quy trình dự án và tăng cường hiệu suất làm việc. Phong cách lãnh đạo của Neha được đặc trưng bởi khả năng dễ dàng điều hành trong điều kiện không rõ ràng và tìm ra các giải pháp sáng tạo cho những thách thức mới nảy sinh. Lấy cảm hứng từ thần thoại Ấn Độ, Neha tiếp cận quản lý dự án với tinh thần kiên định và kiên nhẫn, tin rằng mọi trở ngại đều là cơ hội cho sự phát triển và học hỏi.", true, false, null, null, null, "$2a$04$2oO0.6Uv1ckhAZcOb8z4culCXZMy.piQcekvAvj/4enurWQ9ICgWK", null, false, "i52.png", null, null, (short)0, false, "Ronald McIllroy" },
                    { 53, 7, null, 53000m, "Engaging in unauthorized commercial activities or scams", null, null, "r53.pdf", "56b709f0-d041-45d7-8f83-b6055671d4b5", null, "ktremouletx@tripod.com", true, new DateTime(2023, 4, 17, 16, 27, 0, 0, DateTimeKind.Unspecified), null, null, "Arjun là một Project Manager hấp dẫn với tài năng xây dựng mối quan hệ mạnh mẽ và thúc đẩy sự hợp tác. Với lý lịch trong kỹ thuật xây dựng, anh mang đến một cách tiếp cận có cấu trúc và hệ thống cho các dự án của mình, đảm bảo mọi chi tiết được lập kế hoạch và thực hiện một cách tỉ mỉ. Phong cách lãnh đạo của Arjun được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ nguyên lý karma và dharma, Arjun tiếp cận quản lý dự án với tinh thần mục đích và trách nhiệm, luôn cố gắng tạo ra kết quả tích cực cho cả đội và các bên liên quan.", true, false, null, null, null, "$2a$04$Ua4kw.SZzryF0Ik6MT25d.5liMa2ymjQMp9JkLzagNoyJ0u8tn6P2", null, true, "i53.png", null, null, (short)0, false, "Kelley Tremoulet" },
                    { 54, 2, null, 54000m, "Violating terms of service or user agreement", null, null, "r54.pdf", "713046cd-575d-413d-b7a6-8c920f3c06f5", null, "sdunkersleyy@tuttocitta.it", false, new DateTime(2023, 6, 11, 5, 1, 0, 0, DateTimeKind.Unspecified), null, null, "Ananya là một Project Manager chiến lược nổi tiếng với khả năng phân tích tinh tế và cách tiếp cận tiên tiến. Với lý lịch trong tài chính, cô có hiểu biết sâu sắc về các nguyên tắc kinh doanh và động lực thị trường, mà cô sử dụng để thúc đẩy thành công của dự án. Phong cách lãnh đạo của Ananya được đặc trưng bởi khả năng dự đoán các thách thức tiềm ẩn và tích cực giảm thiểu rủi ro, đảm bảo việc thực hiện dự án diễn ra một cách trơn tru. Lấy cảm hứng từ khái niệm 'jugaad' trong văn hóa Ấn Độ, Ananya hưởng ứng tư duy tiết kiệm và sáng tạo, luôn tìm kiếm các giải pháp sáng tạo để tối ưu hóa tài nguyên và tối đa hóa kết quả của dự án.", true, true, null, null, null, "$2a$04$w8fvqa9FwMX3X5byuleHROC8cyrkKlovsnj0wP2.3gqtngkxei15m", null, true, "i54.png", null, null, (short)0, true, "Sheffy Dunkersley" },
                    { 55, 10, null, 55000m, null, null, null, "r55.pdf", "7437e064-cc69-4b47-8a2e-bbd0e5ab94bc", null, "jyanceyz@redcross.org", false, null, null, null, "Vikram là một Project Manager tầm nhìn với khả năng tưởng tượng và thực hiện các dự án phức tạp một cách chính xác. Với lý lịch trong kiến trúc, anh mang đến một kết hợp độc đáo giữa sự sáng tạo và chuyên môn kỹ thuật cho công việc của mình. Phong cách lãnh đạo của Vikram được đặc trưng bởi tư duy chiến lược và khả năng truyền cảm hứng cho các thành viên trong đội làm việc của anh để tư duy sáng tạo. Lấy cảm hứng từ di sản kiến trúc phong phú của Ấn Độ, Vikram tiếp cận quản lý dự án như một hình thức biểu đạt sáng tạo, luôn thách thức giới hạn của sự đổi mới để mang lại kết quả ấn tượng.", false, false, null, null, null, "$2a$04$jf6Rqk83qj1yl409cxuhreyUG1c1nUwnwYOVRxs1NWDZs6SKwtGGy", null, true, "i55.png", null, null, (short)1, true, "Janifer Yancey" },
