                    { 65, 2, null, 65000m, "Continuously disrupting community events or discussions", null, null, "r65.docx", "d53ecc29-e6dc-493f-90a9-9bce0f36fd2d", null, "iewington19@tamu.edu", false, new DateTime(2023, 10, 17, 19, 24, 0, 0, DateTimeKind.Unspecified), null, null, "Claire, with a degree in fine arts or graphic design, has a talent for creating visually stunning game worlds and characters. Her creativity knows no bounds as she crafts breathtaking landscapes, intricate character designs, and captivating animations that bring games to life.", true, false, null, null, null, "$2a$04$8h6SDxbdE1x65GFfC48uBOEadXN0mKucOXrKmHzHUf1MtvsRv2a7S", null, false, "", null, null, (short)0, false, "Igor Ewington Claire" },
                    { 66, 9, null, 66000m, null, null, null, "r66.docx", "93bfe9fe-cb76-47b2-81ce-4c04674a157e", null, "hangerstein1a@godaddy.com", true, null, null, null, "Tôi là một Backend Developer với 5 năm kinh nghiệm trong ngành công nghệ thông tin. Trình độ chuyên môn của tôi tập trung vào lập trình Java và Python, cùng với các kỹ năng vững về xử lý dữ liệu và tối ưu hóa hiệu suất. Tôi đã tham gia vào nhiều dự án lớn, từ các ứng dụng web đến các hệ thống quản lý cơ sở dữ liệu phức tạp. Sự kiên nhẫn và ham học hỏi là những điểm mạnh của tôi, và tôi luôn mong muốn thách thức bản thân để phát triển mỗi ngày.", false, false, null, null, null, "$2a$04$7ZK8ncz5okb46SXMi2aX/OFn9uu1KmEedijLd68QYqC5vfb82w2Me", null, false, "i66.png", null, null, (short)1, true, "Holmes Angerstein" },
                    { 67, 9, null, 67000m, null, null, null, "r67.docx", "a1143b14-b0a8-4d8a-9dd5-64a760122d89", null, "kfehely1b@amazon.co.jp", false, null, null, null, "một Backend Developer với 3 năm kinh nghiệm. Tôi có kiến thức sâu rộng về lập trình Python và Node.js, cũng như về các công nghệ liên quan đến cơ sở dữ liệu như MySQL và MongoDB. Tôi luôn muốn học hỏi và khám phá những công nghệ mới, và tôi tin rằng việc này giúp tôi ngày càng phát triển và đóng góp nhiều hơn trong dự án mà tôi tham gia.", false, true, null, null, null, "$2a$04$STs4qX6wgYma/k.0Qxap3.ApRyNYRZ.moD849n.URGRUZjVEuF7sS", null, false, "i67.png", null, null, (short)1, false, "Kasper Fehely" },
                    { 68, 5, null, 68000m, "Violation of Community Guidelines", null, null, "r68.docx", "e2553dd4-9d5a-4001-babd-167add4fd093", null, "jcassley1c@harvard.edu", false, new DateTime(2023, 12, 27, 5, 40, 0, 0, DateTimeKind.Unspecified), null, null, "Tôi là một Backend Developer tận tụy với hơn 4 năm kinh nghiệm trong ngành phát triển phần mềm. Sở trường của tôi nằm ở việc xây dựng các hệ thống phức tạp bằng Java và PHP. Tôi luôn chú trọng đến việc viết mã sạch và hiệu quả, cũng như đảm bảo tính ổn định và bảo mật cho ứng dụng. Sự cam kết và trách nhiệm là hai đặc điểm quan trọng trong cách làm việc của tôi.", false, true, null, null, null, "$2a$04$4fFaXEcih4iFQOn40vDLx.9th9oc56K7njiCobya/QCj0tuCNqhs.", null, true, "i68.png", null, null, (short)0, true, "Janean Cassley" },
