                    { 261, new DateTime(2023, 7, 15, 10, 40, 0, 0, DateTimeKind.Unspecified), "Kế hoạch của tôi bao gồm việc chọn lựa các công nghệ mới nhất và phù hợp nhất để xây dựng ứng dụng, kết hợp với việc thiết kế giao diện người dùng thân thiện và dễ sử dụng, tạo ra trải nghiệm tốt nhất cho người dùng.", (short)82, 55, 409, 20538132m, "Greetings! I'm Wendy, a software engineer specializing in digital marketing and analytics platforms. I develop custom solutions that empower marketers to analyze and optimize their campaigns for maximum impact. From building data pipelines to implementing tracking pixels, I'm dedicated to helping businesses make data-driven decisions." },
                    { 262, new DateTime(2023, 8, 31, 9, 5, 0, 0, DateTimeKind.Unspecified), "Quy trình phát triển sẽ được thực hiện một cách linh hoạt và có sự đồng thuận của toàn bộ nhóm, từ việc lập kế hoạch, triển khai đến kiểm thử và cập nhật, nhằm đảm bảo sự nhất quán và chất lượng của sản phẩm.", (short)68, 36, 410, 44201138m, "Hi there! I'm Xavier, a software engineer with expertise in computer vision and image processing. I enjoy working on projects that involve analyzing and understanding visual data, from object detection and recognition to image segmentation and classification. Python, OpenCV, and TensorFlow are my allies in unraveling the secrets hidden within images." },
