                    { 996, new DateTime(2023, 8, 7, 16, 31, 0, 0, DateTimeKind.Unspecified), "Với hơn mười năm tiếp xúc và đam mê với lập trình, tôi đã tích lũy được một kho tàng kiến thức sâu rộng về ngôn ngữ lập trình và các công nghệ liên quan. Trải qua hàng trăm dự án thực tế và giải quyết những thách thức phức tạp, tôi đã phát triển kỹ năng phân tích, thiết kế và triển khai các hệ thống phần mềm hiệu quả. Sự tự tin của tôi không chỉ đến từ kiến thức chuyên môn mà còn từ khả năng tư duy logic và sáng tạo trong việc tìm ra các giải pháp mới cho các vấn đề phức tạp. Tôi tin rằng sự kinh nghiệm lập trình của mình sẽ mang lại giá trị đáng kể cho bất kỳ dự án nào tôi tham gia và làm tăng sức cạnh tranh của đội ngũ phát triển.", (short)20, 146, 444, 39489001m, "Hi, I'm Dan, a software engineer with a passion for audio programming and digital signal processing (DSP). I develop software tools and audio plugins that enable musicians, producers, and sound engineers to create and manipulate audio in creative ways. C++, JUCE framework, and VST/AU standards are my go-to technologies for building audio software." },
                    { 997, new DateTime(2023, 8, 4, 13, 9, 0, 0, DateTimeKind.Unspecified), "Không chỉ dừng lại ở việc viết mã, tôi còn có kỹ năng xuất sắc trong việc phân tích yêu cầu, thiết kế cấu trúc phần mềm và triển khai hệ thống. Sự tỉ mỉ và cẩn thận của tôi trong từng bước tiến hành dự án đảm bảo rằng sản phẩm cuối cùng không chỉ đáp ứng được yêu cầu mà còn đạt được các tiêu chuẩn chất lượng cao nhất.", (short)34, 26, 445, 75178805m, "Hi, I'm Emily, a software engineer specializing in machine vision and robotics. I develop algorithms and software systems that enable robots to perceive and interact with their environment autonomously. From sensor fusion to motion planning, I'm passionate about pushing the boundaries of what robots can achieve." },
