                    { 1008, new DateTime(2024, 2, 5, 19, 18, 0, 0, DateTimeKind.Unspecified), "Integer tincidunt ante vel ipsum. Praesent blandit lacinia erat. Vestibulum sed magna at nunc commodo placerat.\n\nPraesent blandit. Nam nulla. Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede.", (short)58, 163, 456, 65057506m, "Xin chào, tôi là Trần Văn G. Tôi đến từ Hà Tĩnh và là một lập trình viên Full-Stack. Tôi đam mê công việc lập trình và luôn tìm kiếm cơ hội để thử nghiệm những công nghệ mới. Angular, Java và Spring Boot là những công cụ mà tôi thường sử dụng để xây dựng các ứng dụng web chất lượng và ổn định." },
