                    { 1010, new DateTime(2023, 11, 15, 4, 26, 0, 0, DateTimeKind.Unspecified), "Curabitur gravida nisi at nibh. In hac habitasse platea dictumst. Aliquam augue quam, sollicitudin vitae, consectetuer eget, rutrum at, lorem.\n\nInteger tincidunt ante vel ipsum. Praesent blandit lacinia erat. Vestibulum sed magna at nunc commodo placerat.\n\nPraesent blandit. Nam nulla. Integer pede justo, lacinia eget, tincidunt eget, tempus vel, pede.", (short)33, 32, 458, 68863081m, "Xin chào, tôi là Nguyễn Văn L. Tôi đến từ Nha Trang và là một lập trình viên Full-Stack. Tôi đam mê công việc lập trình và luôn tìm kiếm cơ hội để áp dụng những công nghệ mới vào dự án của mình. React, Node.js và PostgreSQL là những công nghệ mà tôi thường sử dụng để xây dựng các ứng dụng web hiệu quả." },
                    { 1011, new DateTime(2023, 11, 7, 23, 37, 0, 0, DateTimeKind.Unspecified), "Integer tincidunt ante vel ipsum. Praesent blandit lacinia erat. Vestibulum sed magna at nunc commodo placerat.", (short)27, 186, 459, 33764461m, "Xin chào mọi người, tôi là Trần Thị M. Tôi đến từ Hải Dương và là một lập trình viên Full-Stack. Tôi có kinh nghiệm trong việc phát triển cả phía Front-end và Back-end của các ứng dụng web. Vue.js, Python và Flask là những công nghệ mà tôi thường sử dụng để xây dựng các dự án của mình." },
                    { 1012, new DateTime(2023, 9, 8, 20, 16, 0, 0, DateTimeKind.Unspecified), "Nullam sit amet turpis elementum ligula vehicula consequat. Morbi a ipsum. Integer a nibh.\n\nIn quis justo. Maecenas rhoncus aliquam lacus. Morbi quis tortor id nulla ultrices aliquet.", (short)11, 156, 460, 34170119m, "Xin chào, tôi là Phạm Văn N. Tôi đến từ Bắc Giang và là một lập trình viên Full-Stack. Tôi có kinh nghiệm trong việc xây dựng các ứng dụng web đa dạng và linh hoạt. React, Express và MongoDB là những công nghệ mà tôi thường sử dụng để phát triển các dự án của mình." },
                    { 1013, new DateTime(2024, 1, 6, 22, 53, 0, 0, DateTimeKind.Unspecified), "Vestibulum ac est lacinia nisi venenatis tristique. Fusce congue, diam id ornare imperdiet, sapien urna pretium nisl, ut volutpat sapien arcu sed augue. Aliquam erat volutpat.\n\nIn congue. Etiam justo. Etiam pretium iaculis justo.\n\nIn hac habitasse platea dictumst. Etiam faucibus cursus urna. Ut tellus.", (short)99, 153, 461, 47669077m, "Xin chào, tôi là Nguyễn Thị O. Tôi đến từ Hà Nam và là một lập trình viên Full-Stack. Tôi đam mê việc sáng tạo và luôn tìm kiếm cách để nâng cao kỹ năng lập trình của mình. Angular, Java và Spring Boot là những công cụ mà tôi thường sử dụng để xây dựng các ứng dụng web chất lượng." },
                    { 1014, new DateTime(2023, 9, 18, 23, 7, 0, 0, DateTimeKind.Unspecified), "Để xây dựng một ứng dụng thành công, tôi sẽ tập trung vào việc đào sâu vào nhu cầu và mong muốn của người dùng thông qua các cuộc phỏng vấn và khảo sát, từ đó phát triển một concept phản ánh được điều này và đồng thời đảm bảo tính tiện ích cao nhất.", (short)84, 197, 462, 61538341m, "Với hơn mười năm kinh nghiệm làm việc trong lĩnh vực công nghệ thông tin, tôi đã tích lũy được một bộ kỹ năng đa dạng và sâu rộng. Sự am hiểu sâu sắc về các công nghệ mới nhất cùng khả năng giải quyết vấn đề hiệu quả là những điểm mạnh mà tôi có thể đem lại cho dự án của bạn. Chắc chắn rằng việc giao nhiệm vụ cho tôi sẽ đem lại kết quả đáng tin cậy và chất lượng cao." },
                    { 1015, new DateTime(2024, 2, 15, 18, 30, 0, 0, DateTimeKind.Unspecified), "Quy trình phát triển sẽ được thực hiện một cách linh hoạt và có sự đồng thuận của toàn bộ nhóm, từ việc lập kế hoạch, triển khai đến kiểm thử và cập nhật, nhằm đảm bảo sự nhất quán và chất lượng của sản phẩm.", (short)56, 116, 463, 27345128m, "Kinh nghiệm của tôi không chỉ giới hạn trong việc lập trình và phát triển ứng dụng, mà còn bao gồm cả quản lý dự án và tư vấn công nghệ, đảm bảo rằng mọi công việc đều được thực hiện một cách suôn sẻ và chuyên nghiệp." },
                    { 1016, new DateTime(2023, 9, 27, 13, 33, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ liên tục theo dõi và thu thập phản hồi từ người dùng để có thể điều chỉnh và cải thiện ứng dụng theo thời gian, đồng thời đảm bảo tính bảo mật và hiệu suất của nó luôn được duy trì ở mức cao nhất.", (short)80, 153, 464, 49083618m, "Sự hiểu biết sâu sắc về các tiêu chuẩn và quy trình trong lĩnh vực công nghệ thông tin giúp tôi đảm bảo tính linh hoạt và tuân thủ đúng theo yêu cầu của dự án." },
                    { 1017, new DateTime(2024, 2, 9, 11, 7, 0, 0, DateTimeKind.Unspecified), "Mục tiêu của tôi không chỉ là xây dựng một ứng dụng, mà còn là tạo ra một hệ sinh thái phản hồi tích cực từ cộng đồng người dùng, từ đó thúc đẩy sự phát triển và cải tiến liên tục của sản phẩm.", (short)45, 193, 465, 65119217m, "Khả năng tương tác tốt với đồng đội và khách hàng là một trong những ưu điểm mà tôi luôn coi trọng, giúp tạo ra một môi trường làm việc tích cực và hợp tác." },
                    { 1018, new DateTime(2023, 12, 24, 7, 34, 0, 0, DateTimeKind.Unspecified), "Đảm bảo tính tương thích và đa nền tảng là một phần không thể thiếu trong kế hoạch của tôi, nhằm mở rộng phạm vi sử dụng và tăng cơ hội tiếp cận cho người dùng.", (short)45, 173, 466, 34073386m, "Kỹ năng phân tích và giải quyết vấn đề của tôi đã được kiểm chứng qua nhiều dự án thành công, từ những hệ thống quy mô nhỏ đến các ứng dụng phức tạp." },
                    { 1019, new DateTime(2023, 9, 13, 6, 39, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ thực hiện các bước kiểm thử và xác thực một cách cẩn thận trước khi triển khai ứng dụng, nhằm giảm thiểu rủi ro và đảm bảo sự ổn định và đáng tin cậy của sản phẩm.", (short)27, 25, 467, 80889151m, "Sự kiên nhẫn và kiên định là hai phẩm chất mà tôi mang lại, giúp tôi vượt qua mọi thách thức và đảm bảo tiến độ dự án luôn được duy trì." },
                    { 1020, new DateTime(2023, 12, 10, 18, 41, 0, 0, DateTimeKind.Unspecified), "Để xây dựng ứng dụng thành công, tôi sẽ tập trung vào việc tạo ra một sản phẩm linh hoạt và mở rộng được, có khả năng tích hợp và mở rộng chức năng theo thời gian để đáp ứng nhu cầu phát triển của người dùng.", (short)3, 78, 468, 24633867m, "Bằng sự cam kết và sự tự tin trong kỹ năng của mình, tôi tin rằng tôi có thể đóng góp một cách tích cực và hiệu quả vào mọi dự án mà tôi tham gia." },
                    { 1021, new DateTime(2024, 2, 10, 5, 47, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ đặt sự tập trung vào việc tối ưu hóa trải nghiệm người dùng, từ việc tối giản hóa giao diện đến tăng cường tính năng và hiệu suất.", (short)15, 101, 469, 15394156m, "Hello, I'm Leo, a software engineer with expertise in backend development and distributed systems. I thrive on architecting scalable and resilient systems that handle massive amounts of data with efficiency. Java, Scala, and Kafka are among my favorite technologies for building high-performance microservices architectures." },
                    { 1022, new DateTime(2023, 12, 3, 3, 34, 0, 0, DateTimeKind.Unspecified), "Kế hoạch của tôi bao gồm việc đảm bảo tính bảo mật cao nhất cho dữ liệu của người dùng, từ việc mã hóa thông tin đến triển khai các biện pháp bảo mật cơ bản và tiên tiến.", (short)92, 44, 470, 68266340m, "Hey there! I'm Mia, a software engineer passionate about e-commerce and digital payments. I specialize in building secure and reliable payment processing systems that facilitate seamless transactions. From integrating payment gateways like Stripe and PayPal to implementing fraud detection algorithms, I'm dedicated to enhancing the online shopping experience." },
                    { 1023, new DateTime(2024, 1, 2, 0, 9, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ liên tục theo dõi và phản hồi nhanh chóng đến mọi phản hồi từ người dùng, từ đó tạo ra một quy trình cải tiến liên tục cho ứng dụng.", (short)62, 111, 471, 57592267m, "Hi, I'm Nate, a software engineer with a focus on virtual reality (VR) and augmented reality (AR) development. I enjoy creating immersive experiences that blur the lines between the digital and physical worlds. Unity and Unreal Engine are my go-to platforms for building interactive VR/AR applications that transport users to new realities." },
                    { 1024, new DateTime(2023, 10, 16, 0, 16, 0, 0, DateTimeKind.Unspecified), "Tôi cam kết tạo ra một sản phẩm có thể tương tác và kết nối với các dịch vụ và nền tảng khác, tạo ra một hệ sinh thái ứng dụng phong phú và linh hoạt.", (short)65, 39, 472, 37680483m, "Greetings! I'm Olivia, a software engineer specializing in web accessibility and inclusive design. I'm passionate about creating digital experiences that are accessible to all users, regardless of their abilities. WCAG guidelines and ARIA attributes are key elements of my toolkit for designing and developing inclusive web applications." },
                    { 1025, new DateTime(2023, 11, 21, 20, 17, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ không ngừng nâng cao kiến thức và kỹ năng của mình, luôn sẵn lòng áp dụng những công nghệ mới và phương pháp tiên tiến nhất vào quy trình phát triển ứng dụng.", (short)43, 196, 473, 60629837m, "Hey, I'm Peter, a software engineer with a focus on bioinformatics and computational biology. I'm passionate about leveraging technology to analyze biological data and unravel the mysteries of life. Python, R, and bioinformatics tools like BLAST and Biopython are my allies in exploring genomics, proteomics, and beyond." },
                    { 1026, new DateTime(2023, 11, 8, 7, 28, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ thiết lập một quy trình triển khai liền mạch và tự động hóa để đảm bảo rằng bất kỳ cập nhật hoặc thay đổi nào cũng được triển khai một cách nhanh chóng và một cách đồng nhất trên mọi nền tảng.", (short)4, 180, 474, 66951725m, "Hi there! I'm Quinn, a software engineer specializing in blockchain and decentralized applications (DApps). I'm fascinated by the potential of blockchain technology to revolutionize industries and empower individuals. Solidity and Ethereum are my primary tools for building smart contracts and decentralized protocols that enable trustless interactions." },
                    { 1027, new DateTime(2023, 8, 9, 10, 32, 0, 0, DateTimeKind.Unspecified), "Tôi sẽ đảm bảo rằng ứng dụng của mình tuân thủ các quy định pháp luật và chuẩn mực ngành trong việc xử lý dữ liệu cá nhân và thông tin cá nhân của người dùng.", (short)71, 30, 475, 87943347m, "Hello, I'm Ryan, a software engineer with expertise in high-frequency trading (HFT) and algorithmic trading systems. I thrive in fast-paced environments where microseconds matter, designing and optimizing trading strategies for maximum efficiency. Python, C++, and platforms like QuantConnect are my playgrounds for quantitative finance and automated trading." },
                    { 1028, new DateTime(2024, 2, 7, 19, 37, 0, 0, DateTimeKind.Unspecified), "Kế hoạch của tôi là bắt đầu bằng việc nắm vững yêu cầu cụ thể của dự án, sau đó tiến hành thiết kế cơ sở dữ liệu và giao diện người dùng đáp ứng những yêu cầu đó. Tiếp theo, tôi sẽ phân tích và lập trình các tính năng chính của ứng dụng, tuân thủ các nguyên tắc thiết kế và quy trình phát triển phần mềm như Agile hoặc Scrum. Đồng thời, tôi sẽ duy trì một quy trình kiểm thử chặt chẽ để đảm bảo tính ổn định và hiệu suất của ứng dụng. Cuối cùng, sau khi ứng dụng được hoàn thiện, tôi sẽ triển khai nó trên Google Play Store và tiếp tục duy trì và nâng cấp theo yêu cầu của người dùng và phản hồi từ thị trường.", (short)60, 74, 476, 49586971m, "Hey, I'm Tom, a software engineer with a focus on cybersecurity and ethical hacking. I'm dedicated to identifying and patching vulnerabilities in software systems to enhance their security posture. From conducting penetration tests to developing security tools, I'm always on the lookout for ways to stay one step ahead of cyber threats." },
                    { 1029, new DateTime(2023, 10, 14, 17, 25, 0, 0, DateTimeKind.Unspecified), "Trong quá trình phát triển ứng dụng Android, việc lập kế hoạch tỉ mỉ là chìa khóa để đảm bảo sự thành công của dự án. Bằng cách phân tích yêu cầu một cách cẩn thận và thiết kế chi tiết từng phần của ứng dụng, chúng ta có thể xác định rõ mục tiêu và hướng đi cho dự án. Việc sử dụng kiến thức lập trình để phát triển ứng dụng đồng thời áp dụng các phương pháp kiểm thử chất lượng sẽ đảm bảo tính ổn định và hiệu suất của sản phẩm. Cuối cùng, việc triển khai và duy trì ứng dụng là bước quan trọng để đưa sản phẩm đến với người dùng và đảm bảo rằng nó luôn hoạt động một cách mượt mà và hiệu quả.", (short)58, 120, 477, 70782116m, "Hi, I'm Uma, a software engineer specializing in cloud-native application development and DevOps practices. I excel in designing and implementing scalable, resilient, and highly available systems on cloud platforms like AWS, GCP, and Azure. Kubernetes, Docker, and Terraform are my go-to tools for building and managing cloud infrastructure." },
