                    { 1181, new DateTime(2024, 2, 5, 17, 3, 0, 0, DateTimeKind.Unspecified), "Khả năng làm việc độc lập mạnh mẽ của tôi cùng với khả năng làm việc nhóm linh hoạt là điều mà tôi luôn tự hào và tin tưởng.", (short)26, 61, 79, 58245998m, "Tôi tự tin rằng, kỹ năng lập trình của mình có thể đóng góp vào sự phát triển và thành công của dự án mà công ty đang triển khai." },
                    { 1182, new DateTime(2023, 10, 12, 19, 17, 0, 0, DateTimeKind.Unspecified), "Với sự cam kết tuyệt đối và tinh thần trách nhiệm cao, tôi luôn đảm bảo dự án được hoàn thành đúng tiến độ và vượt qua mọi mong đợi.", (short)33, 160, 80, 5518289m, "Với sự kiên trì và sự cam kết, tôi sẽ không ngừng hoàn thiện bản thân và đáp ứng được mọi yêu cầu công việc." },
