                    { 1184, new DateTime(2024, 1, 9, 22, 13, 0, 0, DateTimeKind.Unspecified), "Tôi không chỉ là một freelancer, mà còn là một đối tác đáng tin cậy, sẵn sàng hỗ trợ và đồng hành cùng nhà tuyển dụng trong mọi dự án.", (short)33, 131, 82, 29340754m, "Kỹ năng lãnh đạo của tôi đã được phát triển thông qua việc dẫn dắt các nhóm làm việc đa dạng, từ việc hướng dẫn các nhân viên mới đến việc điều phối công việc giữa các bộ phận khác nhau." },
